import { AxiosResponse } from 'axios'
import { createInstance } from '@API/api'

interface PostsType {
	id: number
	title: string
	body: string
}
export const getPosts = (): Promise<AxiosResponse<PostsType>> => {
	return createInstance().get<PostsType>('/posts')
}
